class BaseException(Exception):
    def __init__(self, *args, **kwargs):
        pass


class NameEmptyError(BaseException):
    def __init__(self, *args, **kwargs):
        super().__init__(*args, **kwargs)

    def __str__(self):
        return 'Project name is empty.'
    
    __repr__ = __str__


class FileExistsError(BaseException):
    def __init__(self, file, *args, **kwargs):
        self._file = file
        super().__init__(*args, **kwargs)

    def __str__(self):
        return f'File {self._file} is already exists.'
    
    __repr__ = __str__


class File:
    def __init__(self):
        self._path = ''
        self._name = ''
        self._content = ''

    def write(self):
        _filepath = os.path.join(self._path, self._name)
        with open(_filepath, 'w', encoding='utf-8') as f:
            f.write(self._content)


