class Project:
    def __init__(self):
        self._name = '' 
        self._author = '' 
        self._path = '' 
        self._description = '' 
        self._uuid = '' 
        self._version = '' 
        self._basepath = ''
        self._proj_decs_file_name = ''

        self._dirs = ['app', 'ui', 'test', 'log', 'doc', 'res', 'out', 'res/ico', 'res/pic', 'res/txt']
        self._files = ['app_main.py', 'test_main.py', 'xxx.iss', f'xxx{DescritionFileSuffix}', 'LICENSE', 'readme.txt']

    @property
    def name(self):
        return self._name
    @property
    def author(self):
        return self._author
    @property
    def uuid(self):
        return self._uuid
    @property
    def path(self):
        return self._path
    @path.setter
    def path(self, value):
        self._path = value
        basename = os.path.basename(self._basepath)
        self._basepath = os.path.join(self._path, basename)
    @property
    def basepath(self):
        return self._basepath
    @property
    def description(self):
        return self._description
    @description.setter
    def description(self, value):
        self._description = value
    @property
    def version(self):
        return self._version
    @version.setter
    def version(self, value):
        self._version = value

    def new(self, name, author, path, description):
        self._name = name
        self._author = author
        self._path = path
        self._description = description

        self._uuid = str(uuid.uuid3( \
            uuid.NAMESPACE_DNS, datetime.datetime.strftime(\
            datetime.datetime.now(), "%Y-%m-%d, %H:%M:%S"))).upper()
        self._version = 'beta1.0.0'

        self._basepath = os.path.join(self._path, self._name)
        self._proj_decs_file_name = f'{self._name}{DescritionFileSuffix}'

        self._write_folders()
        self._write_files(True)
        self._write_default_ico()
    
    def load(self, proj_desc_file):
        if os.path.exists(proj_desc_file):
            if os.path.splitext(proj_desc_file)[1] == DescritionFileSuffix:
                self._basepath = os.path.dirname(proj_desc_file)
                self._path = os.path.dirname(self._basepath)
                self._proj_decs_file_name = os.path.basename(proj_desc_file)

                self._read_files()

    def save(self):
        self._write_files(False)

    def _write_folders(self):
        if os.path.exists(self._path):
            if not os.path.exists(self._basepath):
                os.mkdir(self._basepath)
                for d in self._dirs:
                    if not os.path.exists(os.path.join(self._basepath, d)):
                        os.mkdir(os.path.join(self._basepath, d))

    def _write_files(self, flag):
        # write the project description file
        proj_desc_file = os.path.join(self._basepath, self._proj_decs_file_name)
        proj_desc_content = {
            PJ_NAME : self._name,
            PJ_UUID : self._uuid,
            PJ_AUTHOR : self._author,
            PJ_DESCRIPTION : self._description,
            PJ_VERSION : self._version
        }
        ProjDesc().dump(proj_desc_file, proj_desc_content)
        # write iss script
        _defines = {
            PJ_NAME : self._name,
            PJ_VERSION : self._version,
            PJ_AUTHOR : self._author,
            PJ_PATH : self._basepath,
            PJ_UUID : self._uuid
        }
        IssScript(self._basepath, **_defines).write()
        # write version 
        TxtVERSION(self._basepath, self._version).write()
        
        if flag:
            # write readme.txt
            TxtReadme(self._basepath, self._name, self._author, self._description).write()
            # write license 
            GPLv3LICENSE(self._basepath).write()
            # write the app_main.py 
            PyAppMain(self._basepath).write()
            # write the test_main.py 
            PyTestMain(self._basepath).write()

    def _read_files(self):
        proj_desc_file = os.path.join(self._basepath, self._proj_decs_file_name)
        proj_desc_content = ProjDesc().load(proj_desc_file)
        self._name = proj_desc_content[PJ_NAME]
        self._uuid = proj_desc_content[PJ_UUID]
        self._author = proj_desc_content[PJ_AUTHOR]
        self._description = proj_desc_content[PJ_DESCRIPTION]
        self._version = proj_desc_content[PJ_VERSION]

    def _write_default_ico(self):
        ico_path = os.path.join(self._basepath, 'res/ico/icon.ico')
        with open(ico_path, 'wb') as f:
            f.write(DEFAULT_ICO_BINARY)

